// src/components/NavBar.js
// src/components/NavBar.js
import React from 'react';
import './NavBar.css'; // 可选：单独样式文件或统一 SCSS

export default function NavBar({ onNavigate }) {
  return (
    <header id="header" className="fixed-top">
      <div className="container d-flex align-items-center justify-content-between">
        <h1 className="logo" onClick={() => onNavigate('home')} style={{ cursor: 'pointer' }}>
          SkillLens
        </h1>
        <nav id="navbar" className="navbar">
          <ul>
            <li><a onClick={() => onNavigate('home')} className="nav-link">Home</a></li>
            <li><a onClick={() => onNavigate('about')} className="nav-link">About</a></li>
            <li><a onClick={() => onNavigate('services')} className="nav-link">Services</a></li>
          </ul>
        </nav>
      </div>
    </header>
  );
}
